        "γονίας χειμών:in A.Ch.1067 (anap.), acc. to Hsch. εὐχερής, a fair wind; but, acc. to the Sch., ὅταν ἐξ εὐδίας κινηθῇ χαλεπὸν πνεῦμα.,",
        "Γοργόνωτος ἀσπίδος:ἀσπίδος κύκλος, ἡ, a shield with the Gorgon on it, Ar.Ach.1124.,",
