        "ἐννεά-γηρα κορώνη:κορώνη nine times (as) old (as a man), Arat.1022 (ἐννεάνειρα cj. Lobeck).,",
        "ἐννησιάδες Νύμφαι:Νύμφαι island-Nymphs (Lesb.), Hsch.,",
