        "ἐνς ἆς:ἆς· αὔριον, Hsch. (ἔνσας cod.: Cretan or Argive form); cf. εἰς, ἄας.,",
        "ἐντεχν-άζω λόγον:λόγον introduce an elaborate argument, Lib.Eth.6.5.,",
        "ἔντιλτος πλακοῦς:ὁ, prob. a cake seasoned with τιλτόν (q. v.), Clearch.65 (s.v.l.).,",
        "ἐντολ-ιμαῖον γράμμα:γράμμα power of attorney, PMasp.161.14, al. (vi A.D.).,",
        "ἐντροπ-ίας οἶνος:ὁ, = τροπίας, Hsch., Suid.; cf. ἐκτροπίας.,",
        "ἐνυδρ-ίας ἄνεμος:ἄνεμος rainy wind, Call.Fr.39.,",
        "ἐνυπό-κριτος ὑποστιγμή:ὑποστιγμή a stop put after the protasis, Sch.D.T.p.24 H.; cf. ἀνυπόκριτος.,",
        "ἐνφέρνιοι θεοί:dub. sens. in Tab.Defix.Aud.155B3 (Rome, iv/v A.D.; perh. for Lat. inferni).,",
        "ἑξά-βραχυς πούς:πούς foot of six short syllables, Sch.Ar.Av.738, etc.,",
        "ἐξαγκυρῶσαι θύραν:θύραν· ἐκστροφῶσαι, Hsch. (ἐξανκιρῶσαι cod.).,",
        "ἐξακρίζω αἰθέρα:αἰθέρα skim the upper air, E.Or.275; cf. ὑπεξακρίζω.,",
        "ἔξακρος Μενεκρίτου:Μενεκρίτου (physician of Tiberius), name of a bandage for the wrist and hand, Heliod. ap. Orib.48.53.,",
        "ἑξά-στοιχος κριθή:κριθή barley with six rows of grain on the ear, Thphr.HP8.4.2: ἑξά-στιχος in Colum.2.9.14.,",
        "ἑξ-ηρικὸν πλοῖον:= foreg. II, Id.Fr.39.,",
        "ἐξούλης δίκη:ἡ, (ἐξείλλω) action of ejectment, brought by a plaintiff alleged to have been unlawfully ejected from or dispossessed of property, Phryn.Com.42, Com.Adesp.652, D.30 and 31 tit., cf. Harp. ap.Suid. s.v. II. action of ejectment brought by one who claims property in consequence of a judgement of court and is excluded (ejected) from it by the former defendant or his agent, against a defendant who has seized or refused to surrender property, D.21.81,91,52.16. III. metaph., of an action brought to expel or eject an interloper or trespasser, νόμων [̣νόμῳ] ἐξούλης λαχεῖν Aristid.Or.54p.688D.; also ἐξούλης ὑμῖν οὐδ’ ἂν εἷς λάχοι τῆς γῆς Id.1.103J. (Mostly found in gen., but τὴν ἐξούλην D.21.44 (codd. opt.); ἐξούλας ἢ γραφὰς ὦφλον And.1.73.) ,",
        "ἐξυδρίας ἄνεμος:ἄνεμος rainy wind, Arist.Mu.394b19, Ach.Tat.Intr.p.68 M.,",
        "ἐξώκαρπος πάλη:πάλη a form of wrestling, Eust.1572.39.,",
        "ἐξωμ-ίζω τὸν:τὸν ἕτερον βραχίονα bare one arm up to the shoulder, as when wearing an ἐξωμίς, Ar.Ec.267.,",
        "ἔξωμος χιτών:= foreg., Hsch., cf. Aq.Is.15.4.,",
        "ἐξω-χείριον ποιῶ:= Lat. emancipare, Gloss.,",
        "ἐπαιτίνδα παίζειν:παίζειν play at beggars, Hdn.Gr.1.495.,",
        "ἐπακρ-ίδες πόλεις:(ἄκρα) cities on the hills, EM353.1.,",
        "ἐπάμφορος δίκα:(ἐπ-ανα-φέρω) suit sent for retrial after conviction of witnesses for perjury, Foed.Delph.Pell. i A 14, ii B 5.,",
        "ἐπαν-αγωγὸς Τύχη:= Lat. Fortuna Redux, D.C.54.10.,",
        "ἐπὰψ θέμεναι:θέμεναι· πάλιν ἐπικλεῖσαι καὶ ἐπιθεῖναι EM354.25 (leg. ἐπ’ ἂψ θ., v.l. in Il.21.535).,",
        "ἐπεὶ ἦ:v. ἐπεί B.5.,",
        "ἐπέννατος λόγος:λόγος ratio of 10:9, Iamb.in Nic.p.84P.,",
        "ἐπιβατ-όριος ἵππος:ἵππος stallion, interpol. in Suid. s.v. κηλώνιον.,",
        "ἐπιέβδομος λόγος:λόγος ratio of 8:7, Ptol.Harm.1.15.,",
        "ἐπιεικοσθέβδομος λόγος:λόγος ratio of 28:27, Ptol.Harm.1.13.,",
        "ἐπιεικοστόμονος λόγος:λόγος ratio of 22:21, Ptol.Harm.2.1.,",
        "ἐπιείκοστος λόγος:λόγος ratio of 21:20, Ptol.Harm.1.15.,",
